import React from 'react';
import './Projects.css';
import project1 from '../assets/project1.jpg';
import project2 from '../assets/project2.jpg';

const Projects = () => {
  return (
    <div className="projects-container" id="projects">
      <h2 className="section-title">My Projects</h2>

      <div className="project-item">
        <img src={project1} alt="Project 1" className="project-image" />
        <div className="project-details">
          <h3 className="project-title">Remote Finder Utilizing RF and Clap Recognizing Technology</h3>
          <p>
            This project detects underground water leakage in pipelines and
            automatically stops the water supply to avoid wastage. It uses
            sensors and microcontrollers for real-time detection and correction.
          </p>
        </div>
      </div>

      <div className="project-item">
        <img src={project2} alt="Project 2" className="project-image" />
        <div className="project-details">
          <h3 className="project-title">Bike Accident Preventing System</h3>
          <p>
            A full-stack MERN application where users can register student
            details and view them in a dashboard with a search filter. It uses
            MongoDB, Express, React, and Node.js.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Projects;
